public int hashCode() {
  int result = nnId.hashCode();
  result = 31 * result + ipcAddress.hashCode();
  // toString rather than hashCode b/c Url.hashCode is a blocking call.
  result = 31 * result + httpAddress.toString().hashCode();
  return result;
}
